INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (37, 0, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 0, 787, 0, 0, 450, 2, 1, 118501, 2.0, "2021/10/19 12:00:00", 118501, 118501, 0, 118501, "カリン", 0, "かりん", "2030/12/31 15:00:00", 37, 1, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 0, 826, 0, 0, 450, 2, 1, 118601, 2.0, "2024/08/10 21:00:00", 118601, 118601, 0, 118601, "ネビア", 0, "ねびあ", "2030/12/31 15:00:00", 0, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 0, 714, 0, 15, 450, 2, 0, 119001, 2.27, "2021/11/03 19:00:00", 119001, 119001, 0, 119001, "イオ（ノワール）", 0, "いお", "2030/12/31 15:00:00", 7, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 0, 143, 0, 12, 450, 2, 0, 119101, 2.545, "2021/11/16 12:00:00", 119101, 119101, 0, 119101, "クウカ（ノワール）", 0, "くうか", "2030/12/31 15:00:00", 26, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, 0, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 0, 397, 0, 5, 450, 1, 1, 119201, 2.19, "2023/09/19 15:00:00", 119201, 119201, 0, 119201, "マヒル（クリスマス）", 0, "まひる", "2030/12/31 15:00:00", 6, 1, 0);
