INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, 0, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 0, 283, 0, 1, 450, 1, 1, 120701, 1.84, "2025/01/15 15:00:00", 120701, 120701, 0, 120701, "シェフィ（ニューイヤー）", 0, "しぇふぃ", "2025/01/20 11:59:59", 22, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, 0, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 0, 193, 0, 2, 450, 1, 1, 120801, 1.3, "2023/10/16 15:00:00", 120801, 120801, 0, 120801, "ルカ（ニューイヤー）", 0, "るか", "2030/12/31 15:00:00", 22, 1, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, 0, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 0, 424, 0, 12, 450, 2, 1, 120901, 1.425, "2025/01/15 15:00:00", 120901, 120901, 0, 120901, "イリヤ（ニューイヤー）", 0, "いりや", "2025/01/20 11:59:59", 38, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, 0, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 0, 164, 0, 1, 450, 1, 1, 121001, 2.25, "2024/02/22 12:00:00", 121001, 121001, 0, 121001, "ペコリーヌ（オーバーロード）", 0, "ぺこりーぬ", "2024/02/29 11:59:59", 41, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 0, 588, 0, 1, 450, 2, 1, 121101, 2.07, "2024/02/22 12:00:00", 121101, 121101, 0, 121101, "キャル（オーバーロード）", 0, "きゃる", "2024/02/29 11:59:59", 42, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, 0, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 0, 260, 0, 6, 450, 1, 1, 121201, 1.55, "2023/11/16 15:00:00", 121201, 121201, 0, 121201, "ラビリスタ（オーバーロード）", 0, "らびりすた", "2030/12/31 15:00:00", 40, 1, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, 0, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 0, 731, 0, 3, 450, 1, 0, 121301, 1.9, "2022/03/03 19:00:00", 121301, 121301, 0, 121301, "クルミ（ステージ）", 0, "くるみ", "2030/12/31 15:00:00", 3, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 0, 742, 0, 15, 450, 2, 0, 121401, 2.27, "2022/03/15 15:00:00", 121401, 121401, 0, 121401, "ミサキ（ステージ）", 0, "みさき", "2030/12/31 15:00:00", 7, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, 0, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 0, 590, 0, 12, 450, 1, 1, 121501, 2.0, "2024/04/12 12:00:00", 121501, 121501, 0, 121501, "アユミ（怪盗）", 0, "あゆみ", "2024/04/15 14:59:59", 6, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, 0, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 0, 292, 0, 17, 450, 1, 0, 121601, 1.425, "2022/04/15 15:00:00", 121601, 121601, 0, 121601, "イノリ（怪盗）", 0, "いのり", "2030/12/31 15:00:00", 3, 3, 0);
