INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, 0, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 0, 191, 0, 0, 450, 1, 1, 128301, 2.09, "2023/12/31 12:00:00", 128301, 128301, 1, 128301, "イノリ（ニューイヤー）", 0, "いのり", "2030/12/31 15:00:00", 38, 1, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 0, 801, 0, 0, 450, 2, 1, 128401, 2.09, "2025/01/09 12:00:00", 128401, 128401, 0, 128401, "ハツネ（ニューイヤー）", 0, "はつね", "2025/01/15 14:59:59", 21, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 0, 739, 0, 0, 450, 2, 1, 128501, 2.09, "2025/01/09 12:00:00", 128501, 128501, 0, 128501, "カスミ（ニューイヤー）", 0, "かすみ", "2025/01/15 14:59:59", 21, 3, 0);
