INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, 0, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 0, 399, 0, 0, 450, 1, 1, 131601, 1.92, "2025/01/09 12:00:00", 131601, 131601, 0, 131601, "リリ（サマー）", 0, "りり", "2025/01/15 14:59:59", 4, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (44, 0, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 0, 743, 0, 0, 450, 2, 1, 131701, 1.92, "2024/07/31 12:00:00", 131701, 131701, 0, 131701, "アメス（サマー）", 0, "あめす", "2024/08/12 11:59:59", 53, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 0, 709, 0, 0, 450, 2, 0, 131801, 2.09, "2024/08/15 15:00:00", 131801, 131801, 0, 131801, "ホマレ（サマー）", 0, "ほまれ", "2030/12/31 15:00:00", 21, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 0, 725, 0, 0, 450, 2, 1, 131901, 2.09, "2024/08/31 12:00:00", 131901, 131901, 1, 131901, "エミリア（サマー）", 0, "えみりあ", "2030/12/31 15:00:00", 23, 1, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 0, 775, 0, 0, 450, 2, 1, 132001, 2.09, "2024/09/13 12:00:00", 132001, 132001, 0, 132001, "エキドナ（サマー）", 0, "えきどな", "2024/09/25 11:59:59", 21, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (13, 0, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 0, 146, 0, 0, 450, 1, 1, 132101, 2.09, "2024/08/31 12:00:00", 132101, 132101, 0, 132101, "レム（サマー）", 0, "れむ", "2024/09/13 11:59:59", 24, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 0, 721, 0, 0, 450, 2, 1, 132201, 1.84, "2024/09/30 12:00:00", 132201, 132201, 0, 132201, "ノゾミ（アルケミスト）", 0, "のぞみ", "2024/10/10 11:59:59", 7, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 0, 750, 0, 0, 450, 2, 1, 132801, 2.09, "2024/11/30 12:00:00", 132801, 132801, 0, 132801, "ライラエル（クリスマス）", 0, "らいらえる", "2024/12/09 11:59:59", 0, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, 0, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 0, 748, 0, 0, 450, 2, 0, 132901, 2.09, "2024/12/09 12:00:00", 132901, 132901, 0, 132901, "イオ（クリスマス）", 0, "いお", "2030/12/31 15:00:00", 46, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 0, 234, 0, 0, 450, 1, 1, 133001, 2.09, "2024/12/31 12:00:00", 133001, 133001, 0, 133001, "グレイス", 0, "ぐれいす", "2025/01/03 18:59:59", 0, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, 0, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 0, 296, 0, 0, 450, 1, 1, 133201, 2.09, "2024/12/31 12:00:00", 133201, 133201, 1, 133201, "モニカ（ニューイヤー）", 0, "もにか", "2030/12/31 15:00:00", 22, 1, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, 0, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 0, 718, 0, 0, 450, 2, 1, 133501, 2.09, "2025/01/03 19:00:00", 133501, 133501, 0, 133501, "サレン（ニューイヤー）", 0, "されん", "2025/01/15 14:59:59", 22, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 0, 445, 0, 0, 450, 1, 1, 133601, 2.09, "2025/01/20 12:00:00", 133601, 133601, 0, 133601, "メドゥーサ", 0, "めどぅーさ", "2025/01/31 11:59:59", 0, 3, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (8, 0, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 0, 717, 0, 0, 450, 2, 1, 133701, 2.09, "2025/01/31 12:00:00", 133701, 133701, 0, 133701, "ラビリスタ（アルファ）", 0, "らびりすた", "2025/02/10 11:59:59", 0, 3, 0);
