INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, 0, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 0, 850, 0, 0, 450, 1, 1, 191301, 2.22, "2015/04/01 15:00:00", 191301, 191301, 0, 191301, "カズマサ", 0, "かずまさ", "2030/12/31 15:00:00", 6, 1, 0);
